import Meta from "./Meta";
import Header from "./Header";
import Footer from "./Footer";

const Layout = props => (
  <>
    <Meta />
    <Header />
    {props.children}
    <Footer />
    <style jsx>{`
      height: 100vh;
    `}</style>
  </>
);

export default Layout;
